import {
    LOGGED_IN,
    SAVE_NAVIGATION_MODULE
}
    from '../constant';

const SaveLoginInfo = (payload) => {
    return {
        type: LOGGED_IN,
        payload
    }
}

const SetNavigateModule = (payload) => {
    console.log("SetNavigateModule => ", payload);
    return {
        type: SAVE_NAVIGATION_MODULE,
        payload
    }
}

export {
    SaveLoginInfo,
    SetNavigateModule
}
